import React, { useState ,useEffect} from "react";
import axios from "axios"
const Login = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [data, setData] = useState([])
  const [ pincode, setPincode] = useState([])

  function performValidation() {
    return username.length > 0 && password.length > 0;
  }

  function handleSubmit(event) {
    event.preventDefault();
    console.log(pincode)
    getData()

  }



  const getData =()=>{
     axios.get("https://json-server-pavithra.herokuapp.com/beetlenutdata")
    .then((res)=>{
      setData(res.data)
      filtering(data, pincode)})

  }
  console.log(data)
  const filtering =(data,pincode)=>{
    let newList = []
    for (var i = 0; i < data.length; i++) {
      for(var j = 0; j<data[i].Pincodecovered.length; j++)
      {
      // if (data[i].Pincodecovered === pincode) {
      //     newList.push(data[i]);
      console.log(data[i].Pincodecovered[j])
      if(data[i].Pincodecovered[j] === pincode)
      {
        newList.push(data[i].Pincodecovered[j])
      }
      }

  }
  console.log(newList,"list")
  }
  useEffect(()=>{
    // getData()
  },[])


  return (
    <>
    <div>
      <br/><br/>
      <form onSubmit={handleSubmit}>
        <label>Username</label>
        <input
          autoFocus
          type="text"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        /> <br/><br/>
        <label>Password</label>
        <input
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          type="password"
        /> <br/><br/>
        <label>Pincode</label>
        <input type="text" value={pincode} onChange={(e)=>setPincode(e.target.value)}/>
    <br/><br/>
        <button
          block
          bsSize="large"
          disabled={!performValidation()}
          type="submit"
        >
          Login
        </button>
      </form>
    </div>
    <div>
      {
        data?.map(item=>pincode===item.Pincodecovered).filter(item=> pincode === item.Pincodecovered).map(item=><p key={item.BranchIncharge}>{item.BranchName}hey</p>)
      }
    </div>
    </>
  );
};

export default Login;
